import React, { Component } from 'react'
import { createCipher } from 'crypto'
import { ITitleElement } from '../Interfaceses/ITitleElement'
import { Image } from 'react-bootstrap'
import styles from './../styles/scheduleElement.module.css'
export interface ScheduleElementProps {
  title: ITitleElement
}

export interface ScheduleElementState {}

class TitleElement extends React.Component<
  ScheduleElementProps,
  ScheduleElementState
> {
  constructor(props: ScheduleElementProps) {
    super(props)
  }
  render() {
    const element = { ...this.props.title }
    return (
      <div className={styles.main}>
        <div className={styles.titleImage}>
          <Image
            style={{ width: 60, height: 60 }}
            src={require('./../' + element.posterUrl)}
            roundedCircle
          />
          <span className={styles.title}>{element.name}</span>
        </div>

        <div className={styles.numTime}>
          <div className={styles.numTimeFlex}>
            <span className={styles.series}>{element.seriesNum} серия</span>
            <span>12:00</span>
          </div>
        </div>
      </div>
    )
  }
}

export default TitleElement
